export const parseData = (data: any) => {
  try {
    return JSON.parse(data);
  } catch (e) {
    return data;
  }
};

export const parse = (el) => JSON.parse(JSON.stringify(el));

export const fromBase64 = (str: string) => {
  return JSON.parse(Buffer.from(str, "base64").toString());
};

export const isExpired = (dateTime: string) => {
  return new Date().getTime() > new Date(dateTime).getTime();
};

// Encrypt
export const encrypt = (data: string) => {
  const cipherText = encodeURIComponent(
    CryptoJS.AES.encrypt(data, SECRET_KEY).toString()
  );
  return cipherText;
};

export const capitalWords = (str: string) => {
  const words = str.split(" ");

  for (let i = 0; i < words.length; i++) {
    words[i] = words[i][0].toUpperCase() + words[i].substr(1);
  }

  return words.join(" ");
};

export const camelCase = (str: string) => {
  return str
    .replace(/(?:^\w|[A-Z]|\b\w)/g, function (word, index) {
      return index == 0 ? word.toLowerCase() : word.toUpperCase();
    })
    .replace(/\s+/g, "");
};

export const imageFilter = function (file) {
  if (!file.match(/\.(jpg|JPG|jpeg|JPEG|png|PNG)$/)) {
    return false;
  } else {
    return true;
  }
};

export const folderExistCheck = (path: string): boolean => {
  if (!fs.existsSync(path)) {
    fs.mkdirSync(path, { recursive: true });
  }
  return true;
};

export const fileExistCheck = (path: string): boolean => {
  return folderExistCheck(path);
};

export const checkFileExists = (
  directory: string,
  filePath: string
): boolean => {
  const directoryPath = path.join(
    __dirname,
    "../../" + directory + "/" + filePath
  );
  if (fs.existsSync(directoryPath)) {
    return true;
  } else {
    return false;
  }
};

export const fileDelete = (_filePath: string): boolean => {
  try {
    if (fs.existsSync(_filePath)) {
      fs.unlinkSync(_filePath);
      return true;
    }
    return false;
  } catch (err) {
    logger.error(err, "File Delete Error");
    return false;
  }
};

