export const getclientAttendaceCodes = async (clientId) => {
  let docs = await ClientAttendanceType.findAll({
    where: { deletedAt: null, clientId: clientId },
    attributes: [
      "id",
      "statusId",
      "status_code",
      "status_type",
      "bonus_type",
      "reliquatValue",
      // "factor",
      "dates",
      "payment_type",
    ],
    order: [["createdAt", "ASC"]],
  });
  docs = parse(docs);
  let response = {
    presenceOptions: docs
      .filter((el) => el?.status_type == client_attendance_type.WORKED)
      .map((el) => el?.status_code),
    bonusOptions: docs
      .filter(
        (el) =>
          el?.status_type == client_attendance_type.BONUS &&
          el?.bonus_type === bonus_type.RELIQUAT
      )
      .map((el) => {
        return { code: el?.status_code, value: el?.reliquatValue };
      }), //only for Reliquat type bonuses
    allAttendanceArray: docs
      .filter((el) => !["AP", "CA"].includes(el?.status_code))
      .map((el) => el?.status_code),
    absenceArray: docs
      .filter(
        (el) =>
          el?.status_type == client_attendance_type.LEAVE &&
          el?.payment_type == "UNPAID"
      )
      .map((el) => el?.status_code),
    leaveArray: ["CR"],
    caOptions: ["CA"],
    absenceArrOptions: ["AP", "CA"],
  };
  return response;
};

const generate1to26RandomNumber = () =>
  Math.floor(Math.floor(Math.random() * 16) + 5);

const generate1to10RandomNumber = () => Math.floor(Math.random() * 8) + 1;

export const createRandomHash = (length?: number) => {
  const characters =
    "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
  let hash = "";

  for (let i = 0; i < length; i++) {
    const randomIndex = Math.floor(Math.random() * characters.length);
    hash += characters[randomIndex];
  }

  return hash;
};

export const generateUniquePassword = () => {
  const capitalCharacter = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";
  const smallCharacter = "abcdefghijklmnopqrstuvwxyz";
  const numericCharacter = "0123456789";
  const specialCharacter = "!@#$%^&*";

  let password = "";
  password +=
    capitalCharacter[generate1to26RandomNumber()] +
    capitalCharacter[generate1to26RandomNumber()] +
    smallCharacter[generate1to26RandomNumber()] +
    smallCharacter[generate1to26RandomNumber()] +
    smallCharacter[generate1to26RandomNumber()] +
    smallCharacter[generate1to26RandomNumber()] +
    numericCharacter[generate1to10RandomNumber()] +
    numericCharacter[generate1to10RandomNumber()] +
    numericCharacter[generate1to10RandomNumber()] +
    specialCharacter[Math.floor(Math.random() * 7) + 1];

  return password;
};

export const hasOwnProperty = (obj: Object, key: string) => {
  return Object.prototype.hasOwnProperty.call(obj, key);
};

export const generateFourDigitNumber = (): number => {
  return Math.floor(100000 + Math.random() * 900000);
};

export const paginatedResults = (
  page: number,
  limit: number,
  model: string | any[]
) => {
  const startIndex = (page - 1) * limit;
  const endIndex = page * limit;

  let results: any = {};
  if (endIndex < model?.length) {
    results = {
      page: page + 1,
      limit: limit,
    };
  }

  if (startIndex > 0) {
    results = {
      page: page - 1,
      limit: limit,
    };
  }

  results = model.slice(startIndex, endIndex);

  return results;
};

