export const moveFile = async (
  sourceFilePath: string,
  destinationFilePath: string
) => {
  if (!fs.existsSync(path.dirname(destinationFilePath))) {
    fs.mkdirSync(path.dirname(destinationFilePath), { recursive: true });
  }
  fs.rename(sourceFilePath, destinationFilePath, (err) => {
    if (err) {
      console.error("Error moving the file:", err);
    } else {
      console.log("File moved successfully.");
    }
  });
};

export const getClientAccessForUser = (userData: User) => {
  const clientId = [];
  for (const userClientId of userData?.userClientList) {
    if (userClientId?.clientId && !clientId?.includes(userClientId?.clientId)) {
      clientId.push(userClientId?.clientId);
    }
  }
  return clientId;
};

export const getSegmentAccessForUser = (userData: User) => {
  const segmentId = [];
  for (const userSegmentId of userData?.userSegmentList) {
    if (
      userSegmentId?.segmentId &&
      !segmentId?.includes(userSegmentId?.segmentId)
    ) {
      segmentId.push(userSegmentId?.segmentId);
    }
  }
  return segmentId;
};

export const getSubSegmentAccessForUser = (userData: User) => {
  const subSegmentId = [];
  for (const userSegmentId of userData?.userSegmentList) {
    if (
      userSegmentId?.subSegmentId &&
      !subSegmentId?.includes(userSegmentId?.subSegmentId)
    ) {
      subSegmentId.push(userSegmentId?.subSegmentId);
    }
  }
  return subSegmentId;
};

export const timesheetHeaderSeg = (data: any) => {
  let templateString = `<div style="width:33.33%; text-align: center;">
	<span
		style="text-decoration: underline; padding-bottom: 20px; font-size: 18px; color: #a62b24; font-weight: 700; ">
		Pointage du Personnels ${data.timesheetList[0].timesheetData.client.loginUserData.name}</span>
	<br />
	<span
		style="text-decoration: underline; padding-bottom: 20px; font-size: 18px; color: #a62b24; font-weight: 700;">
		Du ${data.timesheetList[0].timesheetData.startDate} Au
			${data.timesheetList[0].timesheetData.endDate}
	</span>
	<br />`;

  if (
    data &&
    data.timesheetList.length > 0 &&
    data.timesheetList[0].timesheetData &&
    data.timesheetList[0].timesheetData.segment &&
    data.timesheetList[0].timesheetData.segment.name
  ) {
    templateString = templateString?.concat(
      " ",
      `<span
				style="text-decoration: underline; padding-bottom: 20px; font-size: 18px; color: #a62b24; font-weight: 700;">
				Segment: ${data.timesheetList[0].timesheetData.segment.name}`
    );
    if (
      data.timesheetList[0].timesheetData.subSegment &&
      data.timesheetList[0].timesheetData.subSegment.name
    ) {
      templateString = templateString?.concat(
        " ",
        `Sub Segment: ${data.timesheetList[0].timesheetData.subSegment.name}`
      );
    }
    templateString = templateString?.concat(" ", `</span>`);
  } else if (
    data &&
    data.timesheetList.length > 0 &&
    data.timesheetList[0].timesheetData &&
    ((data.timesheetList[0].timesheetData.segment &&
      data.timesheetList[0].timesheetData.segment.name) ||
      (data.timesheetList[0].timesheetData.subSegment &&
        data.timesheetList[0].timesheetData.subSegment.name))
  ) {
    templateString = templateString?.concat(
      " ",
      `<span
					style="text-decoration: underline; padding-bottom: 20px; font-size: 18px; color: #a62b24; font-weight: 700;">
					Segment: ${
            data.timesheetList[0].timesheetData.segment
              ? data.timesheetList[0].timesheetData.segment.name
              : "N/A"
          }
						Sub Segment: ${
              data.timesheetList[0].timesheetData.subSegment &&
              data.timesheetList[0].timesheetData.subSegment.name
                ? data.timesheetList[0].timesheetData.subSegment.name
                : "N/A"
            }
				</span>`
    );
  } else {
    templateString = templateString?.concat(
      " ",
      `<span
		style="text-decoration: underline; padding-bottom: 20px; font-size: 18px; color: #a62b24; font-weight: 700;">
		Segment: N/A
	</span>`
    );
  }
  templateString = templateString?.concat(" ", `</div>`);
  return templateString;
};

